import React, { Component } from 'react'
import Button from '@material-ui/core/Button';
import { withStyles } from '@material-ui/core';
import BlueButtonStyles from "./custom-button.style"
const CustomButton = ({ title, highlighted, onClick, classes, color }) => {

    return (
        <Button variant="outlined" color="primary" className={(highlighted) ? classes.buttonHighlighted : classes.button + ` ${classes[color]}`} onClick={onClick}>
            {title}
        </Button>
    )
}
export default withStyles(BlueButtonStyles)(CustomButton)
